#!/usr/bin/env python3

def longest_substring(s1, s2):
	t = [[0]*(1+len(s2)) for i in range(1+len(s1))]
	l, xl = 0, 0
	for x in range(1,1+len(s1)):
		for y in range(1,1+len(s2)):
			if s1[x-1] == s2[y-1]:
				t[x][y] = t[x-1][y-1] + 1
				if t[x][y]>l:
					l = t[x][y]
					xl  = x
			else:
				t[x][y] = 0
	return s1[xl-l: xl]


s1 = ""
s2 = ""
print (longest_substring(s1,s2))